import React, { Component } from 'react';
import {Menu, Container, Button, Header} from 'semantic-ui-react';
import {Link} from 'react-router-dom';
class Navbar extends Component {
    render() {
        return (
            // <div style = {{backgroundColor : "red"}}> NavBar </div>
            <Menu style = {{background : "#E2229C" , height : "80px"}}>
                <Container>
                    <Menu.Item position = "left" as = {Link} to = "/">
                        <Header as = "h1">Hobby Lobby</Header>
                    </Menu.Item>
                    <Menu.Item>
                        <Button primary as = {Link} to = "/login">Login</Button>
                    </Menu.Item>
                    <Menu.Item>
                        <Button primary as = {Link} to = "/signup" content = "Sign Up"/>
                    </Menu.Item>
                </Container>
            </Menu>
        );
    }
}

export default Navbar;
